import React, { useEffect, useState } from "react";

function Home() {
  const [user, setUser] = useState("");

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const res = await fetch("http://localhost:5000/home", {
          method: "GET",
          credentials: "include",
        });
        const data = await res.json();
        if (data.success) {
          setUser(data.user);
        } else {
          setUser("Guest");
        }
      } catch (err) {
        console.error(err);
      }
    };
    fetchUser();
  }, []);

  return (
    <div>
      <h1>Welcome {user}!</h1>
      <p>This is your home page.</p>
    </div>
  );
}

export default Home;
